import "./index.css";
import { Link } from "react-router-dom";

function Logout() {
  return (
    <div className="principal">
      <h2> Você saiu do sistema e será redirecionado em 5 segundos.</h2>
      {setTimeout(<Link to="/login/login">Login</Link>, 3000)}
    </div>
  );
}

export default Logout;
